import Reddit from './assets/redditPurple.webp'
import Github from './assets/githubPurple.webp'
import Forum from './assets/forumPurple.webp'

const SocialList = [
    {
        icon: Twitter,
        social: "Twitter",
        sub: "The latest news and updates."
    },

    {
        icon: Discord,
        social: "Discord",
        sub: "A hub for developers, node operators, and enthusiasts."
    },

    {
        icon: Telegram,
        social: "Telegram",
        sub: "Chat with the worldwide community."
    },

    {
        icon: Reddit,
        social: "Reddit",
        sub: "The Celestia community on Reddit."
    },

    {
        icon: Github,
        social: "Github",
        sub: "Developer discussions and protocol contributions."
    }, 

    {
        icon: Forum,
        social: "Forum",
        sub: "Ask questions and engage in research discussions."
    }
]

export default SocialList
